import React from 'react';
import { FaEnvelope, FaMapMarkerAlt, FaPhoneAlt, FaGraduationCap, FaBriefcase, FaProjectDiagram, FaTools } from 'react-icons/fa';
import '../../resources/templates.css'

function Template5() {
  const user = JSON.parse(localStorage.getItem("shaikhresume-user"));

  return (
    <div className='template5-parent'>
      <div className='template-header text-center py-4'>
        <h1 className='text-uppercase'>{user.firstName} {user.lastName}</h1>
        <div className='contact-info d-flex justify-content-center align-items-center'>
          <p className='m-2'><FaEnvelope className='me-2' /> {user.Email}</p>
          <p className='m-2'><FaMapMarkerAlt className='me-2' /> {user.address}</p>
          <p className='m-2'><FaPhoneAlt className='me-2' /> {user.mobilenum}</p>
        </div>
      </div>

      <div className='divider mt-4'></div>

      <div className='objective mt-4 px-3'>
        <h3 className='section-title'>Objective</h3>
        <p>{user.objective}</p>
      </div>

      <div className='divider mt-4'></div>

      <div className='d-flex justify-content-between align-items-start px-3'>
        <div className='education mt-4'>
          <h3 className='section-title'><FaGraduationCap className='me-2' /> Education</h3>
          <hr />
          {user.Education.map((education, index) => (
            <div key={index} className='education-item mb-3'>
              <h6><b>{education.year}:</b></h6>
              <p><b>{education.Qualification}</b> with <b>{education.Percentage}%</b> in {education.Institution}</p>
            </div>
          ))}
        </div>

        <div className='experience mt-4'>
          <h3 className='section-title'><FaBriefcase className='me-2' /> Experience</h3>
          <hr />
          {user.Experience.map((exp, index) => (
            <div key={index} className='experience-item mb-3'>
              <h6><b>{exp.year}:</b></h6>
              <p><b>{exp.Company}</b> in <b>{exp.Place}</b></p>
            </div>
          ))}
        </div>
      </div>

      <div className='divider mt-4'></div>

      <div className='projects mt-4 px-3'>
        <h3 className='section-title'><FaProjectDiagram className='me-2' /> Projects</h3>
        <hr />
        {user.projects.map((project, index) => (
          <div key={index} className='project-item mb-3'>
            <h6><b>{project.Title} [{project.year}]:</b></h6>
            <p>{project.description}</p>
          </div>
        ))}
      </div>

      <div className='divider mt-4'></div>

      <div className="skills mt-4 px-3">
        <h3 className='section-title'><FaTools className='me-2' /> Skills</h3>
        <ul className='skills-list d-flex flex-wrap'>
          {user.skills.map((skill, index) => (
            <li key={index} className='skill-item me-3'>{skill.technology}</li>
          ))}
        </ul>
      </div>
    </div>
  );
}

export default Template5;
